import React from "react";

const Hamburger = ({ onHamburgerClick }) => {
  return (
    <div>
      <div className="text-end">
        <button className="navitem" onClick={onHamburgerClick}>
          <i className="fa-light fa-xmark" />
        </button>
      </div>
    </div>
  );
};

export default Hamburger;
